 the top navigation level pages for this \nevaluation. Design, layout and organization can contribute to how \nusers flow through the pages of a site, so take a hard look at how clearly this information is presented.',21,3,'ACE2056','2016-08-03 18:01:45','ACE2056','2016-08-03 18:01:45'),(61,'Navigation','Site navigation allows user to get from one place to another on the site.  \nA high-level analysis will help to determine if there is a convenient and obvious way to move within the site.',21,3,'ACE2056','2016-08-03 18:01:45','ACE2056','2016-08-03 18:01:45'),(62,'Forms and data entry','Forms on a website provide an opportunity to extract valuable \ninformation from site users and allow you to form the basis of a relationship.',21,3,'ACE2056','2016-08-03 18:01:45','ACE2056','2016-08-03 18:01:45'),(63,'Page Layout & Visualization','Customers will make judgements about a site largely based\n on the site\'s visual appeal.  Many design styles can be applied to a site however; all sites should adhere to the established design best practices.',21,3,'ACE2056','2016-08-03 18:01:45','ACE2056','2016-08-03 18:01:45'),(64,'Usability Testing','Application testing from various platform channels mentioned as part of development.',21,3,'ACE2056','2016-08-03 18:01:45','ACE2056','2016-08-03 18:01:45');
