l. \n','ACE0279','2013-05-23 11:37:55','ACE0279','2013-05-23 14:00:25'),(313,121,18,8,'This need to be improved. Team currently inserting the methods or file affected after the implementation in IA document. ','ACE0279','2013-05-23 11:37:55','ACE0279','2013-05-23 14:00:25'),(314,122,18,9,'User Story 10.12 does not have any design change scope.','ACE0279','2013-05-23 11:37:55','ACE0279','2013-05-23 14:00:25'),(315,122,18,10,'Not in Scope.','ACE0279','2013-05-23 11:37:55','ACE0279','2013-05-23 14:00:25'),(316,123,18,11,'Code coverage must be improved in-order to handle the negative scenarios. \nThe system uses Query string for most of the pages which must be handled properly. Giving wrong values makes the system unstable. \n\nNeed to use the variables if needed. I could see some of the variables are not used more than one time. \n\nLot of inline java scripts and server side code used in the page. Team can revisit on this to improvise the performance and code clarity. \n','ACE0279','2013-05-23 11:37:55','ACE0279','2013-05-23 14:00:25'),(317,123,18,12,'No changes required for the current user story.','ACE0279','2013-05-23 11:37:55','ACE0279','2013-05-23 14:00:25'),(318,123,18,13,'Not in scope.','ACE0279','2013-05-23 11:37:55','ACE0279','2013-05-23 14:00:25'),(319,124,18,14,'QA Team Test cases are used by the development team. \n\nNegative cases need to be included. I could see some of the cases are missing like adding the values into Registry and verifying the same as new screen provided of that user story.','ACE0279','2013-05-23 11:37:55','ACE0279','2013-05-23 14:00:25'),(320,124,18,15,'Data level cases have been generated for positive cases. ','ACE0279','2013-05-23 11:37:55','ACE0279','2013-05-23 14:00:25'),(321,125,18,16,'Code checked into the SVN. Demo to the client will be considered as source code signoff. ','ACE0279','2013-05-23 11:37:55','ACE0279','2013-05-23 14:00:25'),(322,125,18,17,'No document available for deployement procedure. ','ACE0279','2013-05-23 11:37:55','ACE0279','2013-05-23 14:00:25'),(323,125,18,18,'Not in Scope. ','ACE0279','2013-05-23 11:37:55','ACE0279','2013-05-23 14:00:25'),(324,126,18,19,'most of their code changes are happening with Javascripts. So they are usign the JSLint. \nBut no reports maintained. \n\nTeam has to discuss with Architect/Project manager on the necessity of using the fxcop, ndepend etc. \n\n','ACE0279','2013-05-23 11:37:55','ACE0279','2013-05-23 14:00:25'),(325,127,19,20,'Delivered Pricing Project :-\n\nThere is no document which will show the exact solution structure in TFS, right now at high level the structure will be like Main and Branch.\n\nDepending upon the enhancement/change from customer the respective project will be moved from Main trunk to Branch level. And all the developers will take the  latest from Branch level and continue their enhancement.\n\nOnce it is completed branch code will get merged manually in to Main level in TFS.\n\nTFS server is hosted by client and maintained by Aspire and there is no clarity on how they are doing backup and restore, build automation on the source etc.','ACE1014','2013-05-27 15:07:20','ACE1014','2013-05-27 15:53:42'),(326,127,19,21,'Delivered Pricing Project :-\n\nFor this project there is no separate server for QA and UAT, one server used for both QA and UAT  purposes. \n\nWeb/Silver-light Applications, DB and WCF application have been hosted in the same server.\n\nAll these applications are hosted in share point server and they are using application authentication from the share point site.\n\nThere is no document for understanding all these application binding details with share point site and it had been done by onsite team.','ACE1014','2013-05-27 15:07:20','ACE1014','2013-05-27 15:53:42'),(327,127,19,22,'Delivered Pricing Project :-\n\nQA and UAT environments are same.','ACE1014','2013-05-27 15:07:20','ACE1014','2013-05-27 15:53:42'),(328,127,19,23,'Delivered Pricing Project :-\n\nCode will be always sync with the target repository because they are directly checking in all the modified files in to target  TFS system.','ACE1014','2013-05-27 15:07:20','ACE1014','2013-05-27 15:53:42'),(329,128,19,24,'Delivered Pricing Project :-\n\nNot able to see any technical document which is using the Aspire\'s template. \n\nAlso for some requirements technical documents are available and it is not in Aspire template format also it is not stored in common repository. \n\nSome documents are pulled from mail and some documents are pulled from individuals  local machines.\n\nNFR\'s like browser compatibility, response time, max load, concurrency strategy, exception handling and logging etc are not clearly defined and there is no solid support document available.','ACE1014','2013-05-27 15:07:20','ACE1014','2013-05-27 15:53:42'),(330,128,19,25,'Delivered Pricing Project :-\n\nDon\'t see any document with respect to the requirement gathering process. For some requirements documents are available in share point portal. \n\nSome minor enhancement details are pulled from mail attachments or from individual machines instead of common repository.','ACE1014','2013-05-27 15:07:20','ACE1014','2013-05-27 15:53:42'),(331,128,19,26,'Delivered Pricing Project :-\n\nCurrently saw one document which is maintained locally for the Impact Assessment purpose.\n\nBut it\'s not maintained in a common repository also it was not in Aspire template format.','ACE1014','2013-05-27 15:07:20','ACE1014','2013-05-27 15:53:42'),(332,129,19,27,'Delivered Pricing Project :-\n\nNo design documents was available to evaluate.\n\n','ACE1014','2013-05-27 15:07:20','ACE1014','2013-05-27 15:53:42'),(333,129,19,28,'Delivered Pricing Project :-\n\nNo DB design documents was available to evaluate.','ACE1014','2013-05-27 15:07:20','ACE1014','2013-05-27 15:53:42'),(334,130,19,29,'Delivered Pricing Project :-\n\nNot much to validate because the existing code has been maintained by Aspire, but from our end we can recommend the client for code cleanup and optimization. \n\nCode analysis tools like FxCop execution will benefit the code quality.\n\nAlso for exception logging having too many approaches for a single system will be confusing, some projects uses Enterprise Logging application blocks and in some other project they are using custom text file logging which needs to be cleaned up and a common approach should be implemented.\n\nAlso there is no layers are there in the solution all logic\'s are mixed up in the solution instead of having separate individual projects.\n\nUI, Service, business logic and data access logic\'s are mixed in a single solution which needs to be separated out to a different projects so that the code maintainability will be easier.','ACE1014','2013-05-27 15:07:20','ACE1014','2013-05-27 15:53:42'),(335,130,19,30,'Delivered Pricing Project :-\n\nNo design documents are available, so can\'t evaluate the design adherence for this project.','ACE1014','2013-05-27 15:07:20','ACE1014','2013-05-27 15:53:42'),(336,130,19,31,'Delivered Pricing Project :-\n\nNot much to evaluate since they are reusing the existing SP and UDF also all the DB related tasks have been done by  on site people.','ACE1014','2013-05-27 15:07:20','ACE1014','2013-05-27 15:53:42'),(337,131,19,32,'Delivered Pricing Project :-\n\nFor one change I have seen the UTC but it was not elaborate. \n\nUTC should include positive cases, negative cases, concurrency scenarios and NFR scenarios.  \n\nBut positive and some negative scenarios only covered in the sample UTS shown.\n\nAlso it was not available in the common repository and it was not using the Aspire UTC template format.','ACE1014','2013-05-27 15:07:21','ACE1014','2013-05-27 15:53:42'),(338,131,19,33,'Delivered Pricing Project :-\n\nData oriented test cases are not available to evaluate.','ACE1014','2013-05-27 15:07:21','ACE1014','2013-05-27 15:53:42'),(339,132,19,34,'Delivered Pricing Project :-\n\nThere is no defined process for code release in this project. Also there is no version information maintained for releases.','ACE1014','2013-05-27 15:07:21','ACE1014','2013-05-27 15:53:42'),(340,132,19,35,'No process has been defined for deployment also. Once the code has been developed it will be moved to QA/UAT server.\nCode deployment is done by Aspire Off Shore team and DB changes are done by On Site team and there is no defined process so that both these tasks are done in sync, now everything happening in Adhoc manner.\n\nAlso post deployment configurations are not documented properly for QA release but told that it is followed for UAT release.\n\nDuring the QA release - Release should be version-ed and Release Document should be shared to the QA team so that they know the test coverage and bugs fixed for the current release.\n\nFor Deployment - Folder structuring also done by using some adhoc logics (Creating a folder with Date Time inside the root deployment folder) which will leads to issues.\n\nDeployment Folder structure needs to be based on release version and subsequent hot fixes for that release.','ACE1014','2013-05-27 15:07:21','ACE1014','2013-05-27 15:53:42'),(341,132,19,36,'Delivered Pricing Project :-\n\nRight now it was manual and requested to use TFS build automation feature. ( Also told that currently they are using Cruise Control for some other projects)','ACE1014','2013-05-27 15:07:21','ACE1014','2013-05-27 15:53:42'),(342,133,19,37,'Not much seen to evaluate this.','ACE1014','2013-05-27 15:07:21','ACE1014','2013-05-27 15:53:42'),(343,134,20,2,'Environment details setup document\navailable','ACE1824','2013-05-28 14:13:20','ACE1824','2013-05-28 17:44:49'),(344,134,20,3,'Environment details setup document\navailable','ACE1824','2013-05-28 14:13:20','ACE1824','2013-05-28 17:44:49'),(345,134,20,4,'NA - Client is taking care of UAT environment','ACE1824','2013-05-28 14:13:20','ACE1824','2013-05-28 17:44:49'),(346,134,20,5,'Code is getting synced with the defined target\nrepository. And also automated build\nconfigured for build v