t takes care of DDL changes\n','ACE1390','2014-01-20 17:53:21','ACE1390','2014-01-20 17:58:07'),(1036,403,58,29,'\nSP names are directly used in Command object. It will be better to declare SP names as Constant field and maintained it in separate file.\n\nIn DAL, for retrieving records from DB and populating it in List object, they have used SqlDataReader and looped through the records for fill the list object. \nThis will hit the performance. Also, in SqlDataReader, they have used hard coded columns names to access the filed.\n\nSP Names & Connection string are maintained in Session object, hacker can steal the session.\n\nHave used inline styles in View html page\n','ACE1390','2014-01-20 17:53:21','ACE1390','2014-01-20 17:58:07'),(1037,403,58,30,'Coding is done as per the design template\n','ACE1390','2014-01-20 17:53:21','ACE1390','2014-01-20 17:58:07'),(1038,403,58,31,'N/A - Maintained by client\n','ACE1390','2014-01-20 17:53:21','ACE1390','2014-01-20 17:58:07'),(1039,404,58,32,'Not using any automated unit test cases\n','ACE1390','2014-01-20 17:53:21','ACE1390','2014-01-20 17:58:07'),(1040,404,58,33,'Have covered all test scenario (+ve, -ve, brower compatibility)\n','ACE1390','2014-01-20 17:53:21','ACE1390','2014-01-20 17:58:07'),(1041,405,58,34,'N/A : Maintained by client\n','ACE1390','2014-01-20 17:53:21','ACE1390','2014-01-20 17:58:07'),(1042,405,58,35,'Deployment document needs to be updated as per new build process\n','ACE1390','2014-01-20 17:53:21','ACE1390','2014-01-20 17:58:07'),(1043,405,58,36,'Build is done manually\n','ACE1390','2014-01-20 17:53:21','ACE1390','2014-01-20 17:58:07'),(1044,406,58,37,'\"FxCop was executed with following rules: \n1. Design\n2. Globalization\n3. Naming\n4. Performance\n5. Usage\n6. Security\n\nThere are around 2961 observation/result returned from FxCop which they are planning to fix.\"\n','ACE1390','2014-01-20 17:53:21','ACE1390','2014-01-20 17:58:07'),(1045,407,59,2,'The Document(s) for development environment was found