nt types of Business  Exception and are handled nicely.\n3. Code quality is good however few latest C# coding style could be used like\n   a) Replace if-else with ternary operator.\n   b) Object initializers can be used.\n   c) Lambda Expressions or Linq could be used.\n4. Commented out code could be removed.\n5. Should run code evaluation tools (FxCop or VS code evaluation etc). We can customize the rules as per our project needs.\n','ACE2011','2014-01-22 11:43:59','ACE2011','2014-01-22 11:47:50'),(1055,410,59,12,'NA\n','ACE2011','2014-01-22 11:43:59','ACE2011','2014-01-22 11:47:50'),(1056,410,59,13,'Script quality is good and transactions are handled properly.\n','ACE2011','2014-01-22 11:43:59','ACE2011','2014-01-22 11:47:50'),(1057,411,59,14,'No test cases were available. Developers do a manual unit testing.\n','ACE2011','2014-01-22 11:43:59','ACE2011','2014-01-22 11:47:50'),(1058,411,59,15,'No test cases were available. Developers do a manual unit testing.\n','ACE2011','2014-01-22 11:43:59','ACE2011','2014-01-22 11:47:50'),(1059,412,59,16,'Maintains a checklist that includes what needs to go while releasing the code.\n\n','ACE2011','2014-01-22 11:43:59','ACE2011','2014-01-22 11:47:50'),(1060,412,59,17,'Once code is done and tested on local and Aspire\'s Dev server, developer moves the code to Client\'s Staging Server. Once client approves, the code is then moved to Live Branch.\n','ACE2011','2014-01-22 11:43:59','ACE2011','2014-01-22 11:47:50'),(1061,412,59,18,'No auto build process. Each release is verified manually. \n','ACE2011','2014-01-22 11:43:59','ACE2011','2014-01-22 11:47:50'),(1062,413,59,19,'','ACE2011','2014-01-22 11:43:59','ACE2011','2014-01-22 11:47:50'),(1063,414,60,2,'They are maintaining the information in the VSS.','ACE0279','2014-01-22 14:15:40','ACE0279','2014-01-22 16:11:02'),(1064,414,60,3,'They are maintaining the information in the VSS.','ACE0279','2014-01-22 14:15:40','ACE0279','2014-01-22 16:11:02'),(1065,414,60,4,'Not in their Scope','