58','2014-04-22 17:52:03'),(1723,670,96,14,'N/A','ACE2158','2014-04-08 16:12:11','ACE2158','2014-04-22 17:52:03'),(1724,670,96,15,'Functional test cases are available in HP Quality Center.','ACE2158','2014-04-08 16:12:11','ACE2158','2014-04-22 17:52:03'),(1725,671,96,16,'Delivering to the customer repository after unit testing and customer will assign those changes for testing ','ACE2158','2014-04-08 16:12:11','ACE2158','2014-04-22 17:52:03'),(1726,671,96,17,'Still following the same manual merge logics to configure all the configuration files.','ACE2158','2014-04-08 16:12:11','ACE2158','2014-04-22 17:52:03'),(1727,671,96,18,'Doing the given procedure','ACE2158','2014-04-08 16:12:11','ACE2158','2014-04-22 17:52:03'),(1728,672,96,19,'N/A','ACE2158','2014-04-08 16:12:11','ACE2158','2014-04-22 17:52:03'),(1729,673,97,20,'Nashira Dev - One Click project was taken for this audit\nDevelopers are using client VPN and virtual machines to configure their local workspace. This project is a maintenance project and depending upon the enhancements from main branch source code has been branched out to the Dev branch in TFS with Month and Year as branch labels. For any enhancements if there is no branch available in TFS aspire resource raise a ticket and from client end branch is created. Once the branch is created developers check out the branch source and do their development.\n\nRight  now developers  didn\'t know how the branch is getting merged to main release folder and also branch code was used by client side consultants as well, so all our developers should understand how the merge is happening so that we can double check or avoid potential integration issues.\n','ACE1014','2014-04-09 11:51:39','ACE1014','2014-04-09 21:47:28'),(1730,673,97,21,'Both the QA environment and Dev environment configurtions are in Sync.','ACE1014','2014-04-09 11:51:39','ACE1014','2014-04-09 21:47:28'),(1731,673,97,22,'All QA, Dev and Pre Prod ( UAT ) environment configurations are in Sync.','ACE1014','2014-04-09 11:51:40','ACE1014','2014-04-09 21:47:28'),(1732,673,97,23,'Our developers are using client\'s TFS directly so always code will be synced with target repository. ','ACE1014','2014-04-09 11:51:40','ACE1014','2014-04-09 21:47:28'),(1733,674,97,24,'LTS(Large Number Of Payees) - Requirement taken for this Audit.\n\nNFR\'s like Max number of payee, Max page load time, Max no of concurrent users for a given time, different display resolution support, different platform support etc are missing.','ACE1014','2014-04-09 11:51:40','ACE1014','2014-04-09 21:47:28'),(1734,674,97,25,'Requirement analysis document was available for this enhancement and it covers all the requirement properly.','ACE1014','2014-04-09 11:51:40','ACE1014','2014-04-09 21:47:28'),(1735,674,97,26,'Impact Analysis document was available for this Change request.','ACE1014','2014-04-09 11:51:40','ACE1014','2014-04-09 21:47:28'),(1736,675,97,27,'Audit is done for one enhancement alone and most of the design standards defined are followed while implementing this enhancement.\n\nFor calling WCF service as per the design Unity Dependency Injection patterns are used properly\n\nAlso for the global exception logging IErrorhandler interface implementation is there as per the design.','ACE1014','2014-04-09 11:51:40','ACE1014','2014-04-09 21:47:28'),(1737,675,97,28,'DB design and SQL query standards are well documented and followed properly in queries in SP and UDF\'s available.','ACE1014','2014-04-09 11:51:40','ACE1014','2014-04-09 21:47:28'),(1738,676,97,29,'Able to find inline styling in UI pages which need to be moved to external CSS file so that the same will be cache-able by the client browser which will increase the performance.\n\nAlso avoid mixing events in the HTML file and do it from the java script file for better code management.\n\nNo XML or inline comments found in the controller file which will be an issue if any new resource tries to understand the code logic.\n\nFxCop was not executed for the files related to this CR.\n\nRight now in server side large payee table has been constructed and in order to gain performance pull the data alone from server and construct the table in the client side.','ACE1014','2014-04-09 11:51:40','ACE1014','2014-04-09 21:47:28'),(1739,676,97,30,'In the method GetEBillAccount(int accID, int EbillAccId) - The only value needed is ebillAccountID but instead of fetching this value alone right now the whole EBillAccount object is returned from the service which is unnecessary.\n\nInstead of looping and calling the WCF service inside the loop many times prepare a request as collection and send get the response as collection by calling the WCF service one time alone.\n\nUse partial views where ever required for better code management - For example I saw a file emitting lot of HTML element in a single file based on a condition, the same thing is achieved by using different partial views for better managing and understanding the code also we can reuse the partial view where ever required.','ACE1014','2014-04-09 11:51:40','ACE1014','2014-04-09 21:47:28'),(1740,676,97,31,'All the scripts available are as per the SQL query standards recommended.\n\nIn order to give better user experience we can load the basic HTML structure first then using using Async AJAX calls we can invoke WCF services on demand and fill the data independently to the different sections available. During the service call if the system shows some progress bar or loading GIF image it will improve the user experience.','ACE1014','2014-04-09 11:51:40','ACE1014','2014-04-09 21:47:28'),(1741,677,97,32,'Unit test case is available for the enhancement and it covers all the positve and negative test cases.','ACE1014','2014-04-09 11:51:40','ACE1014','2014-04-09 21:47:28'),(1742,677,97,33,'Not Applicable','ACE1014','2014-04-09 11:51:40','ACE1014','2014-04-09 21:47:28'),(1743,678,97,34,'Developers are using month wise branch in TFS and after completing the development they will execute all the unit test cases prepared and if all the cases are passed then the code will be released for deployment. Always code will be checked in to TFS so always iut is Sync with the target repository.','ACE1014','2014-04-09 11:51:40','ACE1014','2014-04-09 21:47:28'),(1744,678,97,35,'Once unit testing is done build will be queued in TFS and it will do a auto deployment the latest source files to the Dev environment and then integration testing will happen and then the QA and Pre Prod (UAT) build will be queued and respective deployment will happen automatically by TFS.','ACE1014','2014-04-09 11:51:40','ACE1014','2014-04-09 21:47:28'),(1745,678,97,36,'Build will be queued by the developers and and it will do the auto deployment upon successful builds.','ACE1014','2014-04-09 11:51:40','ACE1014','2014-04-09 21:47:28'),(1746,679,97,37,'Instead of calling WCF services Sync if the services are independent call the WCF service as Async AJAX calls so that the rest of the code will execute simultaneously rateher than shoing white screen. \nAlso calling multiple WCF services as AJAX async way it will improve the user experience by providing loadign gifs to the individual place holders or progree bars.\nLoad the HTML properly then call the independent WCF services as asycn AJAX calls with loading notifications so that user experice will be better.','ACE1014','2014-04-09 11:51:41','ACE1014','2014-04-09 21:47:28'),(1747,680,98,2,'1. Internal CI server setup is not available for Amanda7.  (Earlier version also not available).  On Amanda7 it\'s new development and development happens in ZK framework would recommend to bring the CI setup internally.','ACE0060','2014-04-11 11:52:39','ACE0060','2014-04-11 12:17:47'),(1748,680,98,3,'Not in our scope now.','ACE0060','2014-04-11 11:52:39','ACE0060','2014-04-11 12:17:47'),(1749,680,98,4,'Not in our scope now.','ACE0060','2014-04-11 11:52:39','ACE0060','2014-04-11 12:17:47'),(1750,680,98,5,'Code is in sync. with the repositor