4-08-25 11:05:39'),(2511,976,140,28,'Since there is no direct database access, this is not applicable.','ACE1193','2014-08-25 10:54:54','ACE1193','2014-08-25 11:05:39'),(2512,977,140,29,'Coding guidelines are followed mostly, but needs a little improvement (for example, refactoring code by breaking the long methods further.)\n\nWhen asked, it was known that client is not willing to allow refactoring in areas that are already running fine, so don\'t want to touch it.','ACE1193','2014-08-25 10:54:54','ACE1193','2014-08-25 11:05:39'),(2513,977,140,30,'Code is in compliance with respect to the design.','ACE1193','2014-08-25 10:54:54','ACE1193','2014-08-25 11:05:39'),(2514,977,140,31,'N/A','ACE1193','2014-08-25 10:54:54','ACE1193','2014-08-25 11:05:39'),(2515,978,140,32,'Unit test cases should be created. Client has not allowed / followed unit testing so far. But ATG has suggested to recommend the client the use of unit-testing framework.\n\nIf that\'s not possible, atleast write test scenarios manually without a framework.','ACE1193','2014-08-25 10:54:54','ACE1193','2014-08-25 11:05:39'),(2516,978,140,33,'See above.','ACE1193','2014-08-25 10:54:54','ACE1193','2014-08-25 11:05:39'),(2517,979,140,34,'Code released in target repository is tested code.','ACE1193','2014-08-25 10:54:54','ACE1193','2014-08-25 11:05:39'),(2518,979,140,35,'Deployment to staging is handled by the team. Further deployments are handled by client.','ACE1193','2014-08-25 10:54:54','ACE1193','2014-08-25 11:05:39'),(2519,979,140,36,'CI integration not fully implemented.','ACE1193','2014-08-25 10:54:54','ACE1193','2014-08-25 11:05:39'),(2520,980,140,37,'N/A - screens are owned fully by client.','ACE1193','2014-08-25 10:54:54','ACE1193','2014-08-25 11:05:39'),(2521,981,141,2,'The development environement was well configured and connected to the Source control. VS 2005 is being used for the support project and VS2012 for new module development.\nOn boarding document missing.\n\n','ACE2011','2014-08-26 08:28:52','ACE2011','2014-08-26 08:48:19'),(2522,981,141,3,'For both the projects, QA environment is hosted at the client end\n','ACE2011','2014-08-26 08:28:52','ACE2011','2014-08-26 08:48:19'),(2523,981,141,4,'NA','ACE2011','2014-08-26 08:28:52','ACE2011','2014-08-26 08:48:19'),(2524,981,141,5,'Team has switched to TFS from SVN \nThe dev team synchronizes the code as when needed.\n','ACE2011','2014-08-26 08:28:52','ACE2011','2014-08-26 08:48:19'),(2525,982,141,6,'Support Project - For this, main task is maintenance and bug resolution. All the communication occurs via Email\nNew Module - No such documents were found. The client doesn\'t demand for this.\n','ACE2011','2014-08-26 08:28:52','ACE2011','2014-08-26 08:48:19'),(2526,982,141,7,'Support Project - The bugs are resolved and communicated back to the client.\nNew Module - The requirement analysis was done at a high level where the requirements are explained via flow diagrams and UI screenshots\n','ACE2011','2014-08-26 08:28:52','ACE2011','2014-08-26 08:48:19'),(2527,982,141,8,'Support Project - No analysis document. Most of the times bugs requested are questions about an existing functionality.\nNew Module - No IA document is maintained.\n','ACE2011','2014-08-26 08:28:52','ACE2011','2014-08-26 08:48:19'),(2528,983,141,9,'NA','ACE2011','2014-08-26 08:28:52','ACE2011','2014-08-26 08:48:19'),(2529,983,141,10,'NA','ACE2011','2014-08-26 08:28:52','ACE2011','2014-08-26 08:48:19'),(2530,984,141,11,'Support Project -Not much coding is invloved. Just few chages in UI and code behind files. No coding convention doc is being followed due to the limited nature of coding involved.\nNew Module - The code quality was not so good. It needs lot of refactoring.\n','ACE2011','2014-08-26 08:28:52','ACE2011','2014-08-26 08:48:19'),(2531,984,141,12,'NA','ACE2011','2014-08-26 08:28:52','ACE2011','2014-08-26 08:48:19'),(2532,984,141,13,'Support Project -Not very logic oriented scripts are being wriiten as part of feature or bug requests. They majorly involved adding/removing columns from tables.\nNew Module - Code first approach is being followed and there hasn\'t been any need to write scripts so far\n','ACE2011','2014-08-26 08:28:52','ACE2011','2014-08-26 08:48:19'),(2533,985,141,14,'NA','ACE2011','2014-08-26 08:28:52','ACE2011','2014-08-26 08:48:19'),(2534,985,141,15,'NA','ACE2011','2014-08-26 08:28:52','ACE2011','2014-08-26 08:48:19'),(2535,986,141,16,'Support Project - The project has many clients for it. Once a bug is fixed the code is deployed on the Dev server using FTP and remotely logging into the machine. Once tested, the developer then moves the code to the Live server for all the clients.\nNew Module - Manually code is FTPed to Live location\n\n','ACE2011','2014-08-26 08:28:53','ACE2011','2014-08-26 08:48:19'),(2536,986,141,17,'Developer takes backup of previous version of Code and DB and then deployes the code to Live server manually.\n','ACE2011','2014-08-26 08:28:53','ACE2011','2014-08-26 08:48:19'),(2537,986,141,18,'No auto build process. Each release is verified manually. \n','ACE2011','2014-08-26 08:28:53','ACE2011','2014-08-26 08:48:19'),(2538,987,141,19,'','ACE2011','2014-08-26 08:28:53','ACE2011','2014-08-26 08:48:19'),(2539,988,142,2,'The repository is maintained at Aspire SVN and the dev environment is synched against that environment.','ACE0067','2014-08-26 10:45:45','ACE0067','2014-08-26 11:20:28'),(2540,988,142,3,'The QA is done but not audited currently','ACE0067','2014-08-26 10:45:45','ACE0067','2014-08-26 11:20:28'),(2541,988,142,4,'NA','ACE0067','2014-08-26 10:45:45','ACE0067','2014-08-26 11:20:28'),(2542,988,142,5,'Code is maintained up todate','ACE0067','2014-08-26 10:45:45','ACE0067','2014-08-26 11:20:28'),(2543,989,142,6,'The requirements is captured in detail including the deployment model and target environments.\n','ACE0067','2014-08-26 10:45:45','ACE0067','2014-08-26 11:20:28'),(2544,989,142,7,'The performance/operational related challenges of the current dotNET application could to be measured in detail to arrive at the benchmark for the new application.','ACE0067','2014-08-26 10:45:45','ACE0067','2014-08-26 11:20:28'),(2545,989,142,8,'NA','ACE0067','2014-08-26 10:45:45','ACE0067','2014-08-26 11:20:28'),(2546,990,142,9,'The overall framework and the application architecture is captured.  The Design document does not capture the usage of the Eclipse SWT as one of the core part of the solution.\n\nCould think of reducing the overall list of technology stack as the application is expected to be installed in a single desktop machine.  Also, the singleton based approach while handling the card handler unit should be emphasized or implemented to ensure that no parallel threads try to access the machine.\n\nWhen deployed in a network mode, should arrive at the deployment architecture or component architecture to support that.  Specifically, the access of the card handler machines from the central server has to be tried and confirmed.\n','ACE0067','2014-08-26 10:45:45','ACE0067','2014-08-26 11:20:28'),(2547,990,142,10,'Is managed separately.  However the complexity of JPA along with the Spring batch and hibernate could be tried to be reduced as the application is expected to be a miniature and very very few db transactions is expected to be happening.','ACE0067','2014-08-26 10:45:45','ACE0067','2014-08-26 11:20:28'),(2548,991,142,11,'Code has good comment / structure.\nThe PMD / sonar report needs to be looked through as few deviations are found related to the code formatting of the code.','ACE0067','2014-08-26 10:45:45','ACE0067','2014-08-26 11:20:28'),(2549,991,142,12,'Yes, the code adhers to the design.','ACE0067','2014-08-26 10:45:45','ACE0067','2014-08-26 11:20:28'),(2550,991,142,13,'NA as hibernate & JPA is used','ACE0067','2014-08-26 10:45:45','ACE0067','2014-08-26 11:20:28'),(2551,992,142,14,'Not verified at this time.','ACE0067','2014-08-26 10:45:45','ACE0067','2014-08-26 11:20:28'),(2552,992,142,15,'Not verified at this time.','ACE0067','2014-08-26 10:45:45','ACE0067','2014-08-26 11:20:28'),(2553,993,142,16,'Code is not released to the customer repository.\n','ACE0067','2014-08-26 10:45:45','ACE0067','2014-08-26 11:20:28'),(2554,993,142,17,'NA','ACE0067','2014-08-26 10:45:45','ACE0067','2014-08-26 11:20:28'),(2555,993,142,18,'Not extensive at this time.  However the milestone release of the first version of the software is made as zip files.  Shall check with having a formal bundling software like Install shield for further releases.','ACE0067','2014-08-26 10:45:45','ACE0067','2014-08-26 11:20:28'),(2556,994,142,19,'This application has very little user interfaces for some intimations and admin screen.\n','ACE0067','2014-08-26 10:45:45','ACE0067','2014-08-26 11:20:28'),(2557,995,143,2,'','ACE0131','2014-08-26 15:37:21','ACE0131','2014-08-27 15:20:10'),(2558,995,143,3,'','ACE0131','2014-08-26 15:37:21','ACE0131','2014-08-27 15:20:10'),(2559,995,143,4,'','ACE0131','2014-08-26 15:37:21','ACE0131','2014-08-27 15:20:10'),(2560,995,143,5,'','ACE0131','2014-08-26 15:37:21','ACE0131','2014-08-27 15:20:10'),(2561,996,143,6,'','ACE0131','2014-08-26 15:37:21','ACE0131','2014-08-27 15:20:10'),(2562,996,143,7,'','ACE0131','2014-08-26 15:37:21','ACE0131','2014-08-27 15:20:10'),(2563,996,143,8,'','ACE0131','2014-08-26 15:37:21','ACE0131','2014-08-27 15:20:10'),(2564,997,143,9,'The Datacontracts are bloating\n\nTable normalisation - User table is not in normalised form. Even though the DB design is not in our hands, was the change debated with the customer? No\nAt least a highlight should have been made from our end.','ACE0131','2014-08-26 15:37:21','ACE0131','2014-08-27 15:20:10'),(2565,997,143,10,'','ACE0131','2014-08-26 15:37:21','ACE0131','2014-08-27 15:20:10'),(2566,998,143,11,'unnecessary - code can be avoided\ncheck for if null without else, not letting the exception block to capture the exception due to Null object - actually suppress the error occurred and swallows the exception. \n\nThere should not be any problem in at least remove unused Using for the pages being developed or touched.','ACE0131','2014-08-26 15:37:21','ACE0131','2014-08-27 15:20:11'),(2567,998,143,12,'','ACE0131','2014-08-26 15:37:21','ACE0131','2014-08-27 15:20:11'),(2568,998,143,13,'SQL queries uses parameter as such....\nThere is a Format function for appending the escape character.\nBut still this can be compromised by adding \' SQL query  --- to user input. Can you try and comeback?\n\nDoes your input filters these. If not all such query are vulnerable to SQL injection.\nSo better leave that to SQL server by using parameters.\n','ACE0131','2014-08-26 15:37:21','ACE0131','2014-08-27 15:20:11'),(2569,999,143,14,'Not checked','ACE0131','2014-08-26 15:37:21','ACE0131','2014-08-27 15:20:11'),(2570,999,143,15,'','ACE0131','2014-08-26 15:37:21','ACE0131','2014-08-27 15:20:11'),(2571,1000,143,16,'','ACE0131','2014-08-26 15:37:21','ACE0131','2014-08-27 15:20:11'),(2572,1000,143,17,'','ACE0131','2014-08-26 15:37:21','ACE0131','2014-08-27 15:20:11'),(2573,1000,143,18,'','ACE0131','2014-08-26 15:37:21','ACE0131','2014-08-27 15:20:11'),(2574,1001,143,19,'Good to see that the configuration for web service have limiting values on incoming payload.','ACE0131','2014-08-26 15:37:21','ACE0131','2014-08-27 15:20:11'),(2575,1002,144,2,'Environment confirms to design spec. Access is available through VPN','ACE2164','2014-08-27 12:40:15','ACE2164','2014-08-27 13:05:09'),(2576,1002,144,3,'This is customer controlled. We have access to this environment','ACE2164','2014-08-27 12:40:15','ACE2164','2014-08-27 13:05:09'),(2577,1002,144,4,'This is customer controlled. We have access to this environment','ACE2164','2014-08-27 12:40:15','ACE2164','2014-08-27 13:05:09'),(2578,1002,144,5,'Unit testing is done and then checked in','ACE2164','2014-08-27 12:40:15','ACE2164','2014-08-27 13:05:09'),(2579,1003,144,6,'Jira and confluence based  tracking','ACE2164','2014-08-27 12:40:15','ACE2164','2014-08-27 13:05: