m user interface is been directly used to form the script. \nEg: query.Append(\"Delete from EmployerContribution Where EmployerContributionId=\'\" + employerContribution.EmployerContributionId + \"\'\");\n\n2) There are newly created classes which is no longer needed for inheritance. Those can be marked as sealed for better performance.\nEg: public class EmployerContribution : BaseEntity\n\n3) Audit fields in db (created/updated) is getting time from app server which may leads to time differences. It is better to have the time updated from database.\n\n4) Also need more attention on choosing .net datatypes against sql datatypes. There is usage of integer in database and long in application.\n\n5) There are deadcode/commented codes here and there. Those should be corrected before check-in.\n','ACE1010','2015-03-23 19:51:57','ACE1010','2015-03-23 19:51:57'),(3989,1562,222,30,'No design evidenced for the module \"Employer contribution\"','ACE1010','2015-03-23 19:51:57','ACE1010','2015-03-23 19:51:57'),(3990,1562,222,31,'There are no foreign keys defined for the table [TenantPlan] where it actually needs.','ACE1010','2015-03-23 19:51:57','ACE1010','2015-03-23 19:51:57'),(3991,1563,222,32,'No unit test cases exists','ACE1010','2015-03-23 19:51:57','ACE1010','2015-03-23 19:51:57'),(3992,1563,222,33,'Functional unit test cases exists for the module \"Employer contribution\"','ACE1010','2015-03-23 19:51:57','ACE1010','2015-03-23 19:51:57'),(3993,1564,222,34,'Not reviewed as no changes reported since last audit cycle.','ACE1010','2015-03-23 19:51:57','ACE1010','2015-03-23 19:51:57'),(3994,1564,222,35,'Not reviewed as no changes reported since last audit cycle.','ACE1010','2015-03-23 19:51:57','ACE1010','2015-03-23 19:51:57'),(3995,1564,222,36,'Not reviewed as no changes reported since last audit cycle.','ACE1010','2015-03-23 19:51:57','ACE1010','2015-03-23 19:51:57'),(3996,1565,222,37,'Not much to evaluate for this cycle.','ACE1010','2015-03-23 19:51:57','ACE1010','2015-03-2