251,5,'Release level branching is available. Trunk is used for storing the project source code.','ACE2641','2015-05-12 16:46:46','ACE2641','2015-05-20 17:24:31'),(4505,1763,251,6,'Technical documents are available. NFR\'s has been captured on the feature level. Because of this, they don’t have any separate document.','ACE2641','2015-05-12 16:46:46','ACE2641','2015-05-20 17:24:31'),(4506,1763,251,7,'System overview document are available.','ACE2641','2015-05-12 16:46:46','ACE2641','2015-05-20 17:24:31'),(4507,1763,251,8,'There is no specific document is maintained to track the changes in code. They have only documents for requirement changes and it has been tracked in separate excel sheet in repository.','ACE2641','2015-05-12 16:46:46','ACE2641','2015-05-20 17:24:31'),(4508,1764,251,9,'This project follows N-Tier architecture. Each projects resembles the layer name correctly. Also folder structure has been followed correctly to maintain the projects. \nThere is no use case design, sequence diagrams or class diagrams to explain the flow of the project.','ACE2641','2015-05-12 16:46:46','ACE2641','2015-05-20 17:24:31'),(4509,1764,251,10,'Followed code first approach in Entity Framework. All tables are deisgned as per the standarads. Predominately they have used LINQ queries and only few places they have used Stored Procedure.','ACE2641','2015-05-12 16:46:46','ACE2641','2015-05-20 17:24:31'),(4510,1765,251,11,'Team follows the coding standards.They have it in document manner also.\nIn only few places alone, i can see there is misleading.\nBundling is yet to be implemented.\nunused name spaces should be removed. \nDead codes should be removed.','ACE2641','2015-05-12 16:46:46','ACE2641','2015-05-20 17:24:31'),(4511,1765,251,12,'The code is compliance with the architecture prescribed in the document. ','ACE2641','2015-05-12 16:46:46','ACE2641','2015-05-20 17:24:31'),(4512,1765,251,13,'Good','ACE2641','2015-05-12 16:46:46','ACE2641','2015-05-20 17:24:31'),(4513,1766,251,14,'