9:41:58'),(6436,2514,358,29,'Code quality should be improved:\nPSR standards not being followed in multiple places - like missing space after if, foreach, and while.','ACE1193','2015-08-31 19:32:06','ACE1193','2015-08-31 19:41:58'),(6437,2514,358,30,'Design adherence requires improvement - particularly how the functionality is translated into proper design and then code.  E.g. checking for equality of a string with space (i.e. not trimming the incoming data) should be strictly avoided.','ACE1193','2015-08-31 19:32:06','ACE1193','2015-08-31 19:41:58'),(6438,2514,358,31,'N/A','ACE1193','2015-08-31 19:32:06','ACE1193','2015-08-31 19:41:58'),(6439,2515,358,32,'Unit tests were not written for the public methods in the services.','ACE1193','2015-08-31 19:32:06','ACE1193','2015-08-31 19:41:58'),(6440,2515,358,33,'See above.','ACE1193','2015-08-31 19:32:06','ACE1193','2015-08-31 19:41:58'),(6441,2516,358,34,'Issues found in UI when tested across different resolutions.  A graph was displayed with a scrollbar when viewed in 1024x768 resolution, which is a standard tab resolution.','ACE1193','2015-08-31 19:32:06','ACE1193','2015-08-31 19:41:58'),(6442,2516,358,35,'Deployment is handled by client.','ACE1193','2015-08-31 19:32:06','ACE1193','2015-08-31 19:41:58'),(6443,2516,358,36,'Build procedure is in place, but since things like code validation and unit tests are missing, there is not much use.','ACE1193','2015-08-31 19:32:06','ACE1193','2015-08-31 19:41:58'),(6444,2517,358,37,'NA','ACE1193','2015-08-31 19:32:06','ACE1193','2015-08-31 19:41:58'),(6445,2518,359,20,'Developers workspaces are configured properly.','ACE1193','2015-08-31 19:49:37','ACE1193','2015-08-31 20:04:00'),(6446,2518,359,21,'There is no internal QA for this project; so no separate system observed.','ACE1193','2015-08-31 19:49:37','ACE1193','2015-08-31 20:04:00'),(6447,2518,359,22,'UAT environment has been recently configured.  Further work will be taken up as releases happen. ','ACE1193','2015-08-31 19:49:37','ACE1193','2015-08-31 20:04:00'),(6448,2518,359,23,'Code is in proper sync with target repository.','ACE1193','2015-08-31 19:49:37','ACE1193','2015-08-31 20:04:00'),(6449,2519,359,24,'Functional requirements are tracked in Trello.  So far, no major tasks/issues related to non-functional requirements came up.','ACE1193','2015-08-31 19:49:37','ACE1193','2015-08-31 20:04:00'),(6450,2519,359,25,'Analysis details are captured in Trac.','ACE1193','2015-08-31 19:49:37','ACE1193','2015-08-31 20:04:00'),(6451,2519,359,26,'Impact analysis details are captured, but could be improved to make it more granular at class / method level.','ACE1193','2015-08-31 19:49:37','ACE1193','2015-08-31 20:04:00'),(6452,2520,359,27,'Django framework\'s design standard is mostly followed.  But improvement required in certain areas:\n* Breakdown larger methods (e..g pdf_render) into smaller.\n* Improve randomness by using a better utility or mechanism rather than just using rand * a long int. E.g. a random id based on machine\'s MAC id, timestamp and a random number is guaranteed to be more unique than just random number.','ACE1193','2015-08-31 19:49:37','ACE1193','2015-08-31 20:04:00'),(6453,2520,359,28,'N/A','ACE1193','2015-08-31 19:49:37','ACE1193','2015-08-31 20:04:00'),(6454,2521,359,29,'Mostly follows PEP8 standards.\n\nMinor improvements required:\n* Naming of variables/parameters should be relevant (e.g. year instead of k)\n* Spacing issues should be fixed in pdf_render method.','ACE1193','2015-08-31 19:49:37','ACE1193','2015-08-31 20:04:00'),(6455,2521,359,30,'Code is in adherence to design as instituted / followed as per Django framework\'s design principles.','ACE1193','2015-08-31 19:49:37','ACE1193','2015-08-31 20:04:00'),(6456,2521,359,31,'N/A','ACE1193','2015-08-31 19:49:37','ACE1193','2015-08-31 20:04:00'),(6457,2522,359,32,'Unit testing not observed for latest changes.','ACE1193','2015-08-31 19:49:37','ACE1193','2015-08-31 20:04:00'),(6458,2522,359,33,'See above.','ACE1193','20