signs.','ACE0241','2015-08-31 19:53:16','ACE0241','2015-08-31 23:40:33'),(6468,2526,360,7,'Requirements provided in customer jira. \nSome times requirements are shared through the word document in mails or confluence.  Team creates tickets for them in Jira . Master tickets MT-11188/MT-11350 was missing reference to confluence link  of the requirement and word document not attached even.\n\nRequirement analysis and clarifications happens in Jira.','ACE0241','2015-08-31 19:53:16','ACE0241','2015-08-31 23:40:33'),(6469,2526,360,8,'Root cause and impact analysis are added for support issues. ','ACE0241','2015-08-31 19:53:16','ACE0241','2015-08-31 23:40:33'),(6470,2527,360,9,'Same comment as last review. Design documents are done for the Major enhancements. For minor support tickets, it is recommended to provide technical notes possibly in the JIRA itself','ACE0241','2015-08-31 19:53:16','ACE0241','2015-08-31 23:40:33'),(6471,2527,360,10,'Database changes are mentioned as part of design.','ACE0241','2015-08-31 19:53:16','ACE0241','2015-08-31 23:40:33'),(6472,2528,360,11,'1. Reviwed BatchPayment.java, BatchManager.java and its related UI changes.\n\nBatchManager.java - IO exception is suppressed and  just added logger.  Adding comments will help for what reason its suppressed and what behavior it will happen to the user. \nAlso, old copy right used in the class. \n\nExcept above code quality is good.\n\n2. Central CI available, but only used for build and has large number of sonor issues. Need to make sure at least new code should contain sonar issues.\n3. Eclispse code analysis tools like Findbug, Sonor are not used\n4. Junit not implemented.  Team said customer is not agreed for it.\n \n\n','ACE0241','2015-08-31 19:53:16','ACE0241','2015-08-31 23:40:33'),(6473,2528,360,12,'For selected requirements design are developed. Last release they didn\'t have design document. This release they have design and implementation still going on.','ACE0241','2015-08-31 19:53:16','ACE02