','2015-09-25 18:04:36'),(6740,2632,375,27,'Design document is available in confluence and auditee has good knowledge in design aspects.','ACE1688','2015-09-25 17:49:17','ACE1688','2015-09-25 18:04:36'),(6741,2632,375,28,'Design document itself covers database design , maintained by customer','ACE1688','2015-09-25 17:49:17','ACE1688','2015-09-25 18:04:36'),(6742,2633,375,29,'Reviewed QueryService.java,QueryServiceImpl.java,BatchSerice.java,BAtchServiceIMpl.java. Code quality is good. Recommended to add sonar or pmd to inspect the code quality.Exception handling can be improved.','ACE1688','2015-09-25 17:49:17','ACE1688','2015-09-25 18:04:36'),(6743,2633,375,30,'code is in adherence with design','ACE1688','2015-09-25 17:49:17','ACE1688','2015-09-25 18:04:36'),(6744,2633,375,31,'Following the design standards of the Customer where the team has scope in SQL development.','ACE1688','2015-09-25 17:49:17','ACE1688','2015-09-25 18:04:36'),(6745,2634,375,32,'Test classes are available. ','ACE1688','2015-09-25 17:49:17','ACE1688','2015-09-25 18:04:36'),(6746,2634,375,33,'N/A','ACE1688','2015-09-25 17:49:17','ACE1688','2015-09-25 18:04:36'),(6747,2635,375,34,'self review as well as review with customer is happening before release.','ACE1688','2015-09-25 17:49:17','ACE1688','2015-09-25 18:04:36'),(6748,2635,375,35,'Customer controlled','ACE1688','2015-09-25 17:49:17','ACE1688','2015-09-25 18:04:36'),(6749,2635,375,36,'customer controlled','ACE1688','2015-09-25 17:49:17','ACE1688','2015-09-25 18:04:36'),(6750,2636,375,37,'','ACE1688','2015-09-25 17:49:17','ACE1688','2015-09-25 18:04:36'),(6751,2637,376,2,'1. Jenkins setup is fine and it has automated builds happens\nby daily evening. \n2. Sonar report is available.\n3. Freezing  the browser version is still in discussion with customer. This has been brought in the previous audit. No action taken till now.\n4. SQL server version 2005 is mentioned in the Environment document, but in developer machine they are using SQL server 2008.\n5. Duplicate Spring versions found in the <Tomcat_home>/webapp/WEB-INF/lib folder. Found spring 2.5.6 and spring 3.0.1 jars. Seems like they are using the older version of spring in their application. This can be removed from the tomcat library.\n\nGone through the SHK-PQP-Environment.doc\n\nThe following comments are brought from the previous audit but not yet addressed.\n 1. On the development environment doc. refine the versions defined for Firefox and chrome.\n 2. Extend the environment doc to include project work setup.\n','ACE0773','2015-09-25 19:56:00','ACE0773','2015-09-25 20:49:57'),(6752,2637,376,3,'Tomcat version and java version are verified in QA environment. It is fine.','ACE0773','2015-09-25 19:56:00','ACE0773','2015-09-25 20:49:57'),(6753,2637,376,4,'Not in scope','ACE0773','2015-09-25 19:56:00','ACE0773','2015-09-25 20:49:57'),(6754,2637,376,5,'Code synchronization is happening on daily basis.','ACE0773','2015-09-25 19:56:00','ACE0773','2015-09-25 20:49:57'),(6755,2638,376,6,'Gone through the general Non functional requirement for the PQP color drive application, since there is no scope for the sample (Score card Category) audited. ','ACE0773','2015-09-25 19:56:01','ACE0773','2015-09-25 20:49:57'),(6756,2638,376,7,'Requirements are maintained in document (Doc - SHK-PQP-ColorDrive-UI-Stage_Reports.doc). Gone through the (Score card Category) and questions raised from the team.','ACE0773','2015-09-25 19:56:01','ACE0773','2015-09-25 20:49:57'),(6757,2638,376,8,'Impact analysis done for Score card requirement and it is available in Doc - SHK-PQP-Color Drive-4.2.1_Impact_Analysis.xlsx.\n\nSince this is kind of small enhancement, there is no much scope for detailed analysis','ACE0773','2015-09-25 19:56:01','ACE0773','2015-09-25 20:49:57'),(6758,2639,376,9,'Since it is an enhancement, there is no scope for class level design.\nThe score card category and its related UI design are captured and discussed the same with customer.','ACE0773','2015-09-25 19:56:01','ACE0773','2015-09-25 20:49:57'),(6759,2639,376,10,'No scope for this enhancement.','ACE0773','2015-09-25 19:56:01','ACE0773','2015-09-25 20:49:57'),(6760,2640,376,11,'Since it an enhancement and bug fixes during the last two months, the scope is very limited.\n\nVerified the following java files,\nControllerConstants.java\nStageReportInfo.java\nStageReportConstructXml.java\nStageReportHelperClass.java\nStageReportService.java\n\nThough the above things are fine, the previous audit comments are not addressed and still sonar critical items are abnormal.\nOn the sonar - 521 critical items are reported,\nsince we are the owner for this product it\'s\nmandate to zero items defined in blocker and\ncritical.\n','ACE0773','2015-09-25 19:56:01','ACE0773','2015-09-25 20:49:57'),(6761,2640,376,12,'Enhancement and code changes for bug fixes are adhere to the existing design.','ACE0773','2015-09-25 19:56:01','ACE0773','2015-09-25 20:49:57'),(6762,2640,376,13,'No scope for this enhancement.','ACE0773','2015-09-25 19:56:01','ACE0773','2015-09-25 20:49:57'),(6763,2641,376,14,'junit test cases are not available for Score card category\nclass - part of the current development.','ACE0773','2015-09-25 19:56:01','ACE0773','2015-09-25 20:49:57'),(6764,2641,376,15,'Functional test cases are provided by testing\nmember and those are maintained in testlink','ACE0773','2015-09-25 19:56:01','ACE0773','2015-09-25 20:49:57'),(6765,2642,376,16,'code is checked-in at the repository without\nany issues. Peer review is happening before committing in into target repository','ACE0773','2015-09-25 19:56:01','ACE0773','2015-09-25 20:49:57'),(6766,2642,376,17,'manual deployment steps are in place. Bringin\nthe steps to automate it.','ACE0773','2015-09-25 19:56:01','ACE0773','2015-09-25 20:49:57'),(6767,2642,376,18,'maven script is available.','ACE0773','2015-09-25 19:56:01','ACE0773','2015-09-25 20:49:57'),(6768,2643,376,19,'Major work scope is not there for us. client\nprovide us the html skeleton.','ACE0773','2015-09-25 19:56:01','ACE0773','2015-09-25 20:49:57'),(6769,2644,377,2,'Environment set up document for UI refresh project is not available, it is recommended to create a document with required software and versions  to make consistency across the development team','ACE2040','2015-09-30 18:45:53','ACE2040','2015-09-30 20:39:43'),(6770,2644,377,3,'QA environment is available. Recommended to have a note on the environments that should be part of QA Server as agreed.','ACE2040','2015-09-30 18:45:53','ACE2040','2015-09-30 20:39:43'),(6771,2644,377,4,'UAT environment is not in scope of Aspire Team.','ACE2040','2015-09-30 18:45:53','ACE2040','2015-09-30 20:39:43'),(6772,2644,377,5,'Code are synchronized with the Aspire SVN repository on daily basis.  Code are delivered to the customer SVN as well on a mentioned interval.','ACE2040','2015-09-30 18:45:53','ACE2040','2015-09-30 20:39:43'),(6773,2645,377,6,'Requirements are available in the SVN. Non functional requirement is available in the Kickoff presentation. ','ACE2040','2015-09-30 18:45:53','ACE2040','2015-09-30 20:39:43'),(6774,2645,377,7,'Requirements are analyzed and clarifications are verified with the customers through calls and mails. Clarification details are captured and available in the SVN.','ACE2040','2015-09-30 18:45:53','ACE2040','2015-09-30 20:39:43'),(6775,2645,377,8,'Impact are analyzed, captured and discussed','ACE2040','2015-09-30 18:45:53','ACE2040','2015-09-30 20:39:43'),(6776,2646,377,9,'Mock pages are designed and shared with the customer; once approved taken for the implementation. Overall design for the development is available and specific module developments are highlighted by sharing the comparison between the Existing and New UI','ACE2040','2015-09-30 18:45:53','ACE2040','2015-09-30 20:39:43'),(6777,2646,377,10,'Database design are not applicable\n','ACE2040','2015-09-30 18:45:53','ACE2040','2015-09-30 20:39:43'),(6778,2647,377,11,'1.Angular Code guidelines document is available 2. Developed codes are code reviewed and code review comments are available in TRAC. It is recommended to do for all the changes. 3. Audited codes are developed to the standards. 4. LESS framework is implemented as per the last audit recommendation 5. Blocker and Critical issues in SONAR found in last cycle are still exists. Recommended to solve the issues as possible','ACE2040','2015-09-30 18:45:53','ACE2040','2015-09-30 20:39:43'),(6779,2647,377,12,'Team is following the architectural design set for the development.','ACE2040','2015-09-30 18:45:53','ACE2040','2015-09-30 20:39:43'),(6780,2647,377,13,'Not in scope of development team','ACE2040','2015-09-30 18:45:53','ACE2040','2015-09-30 20:39:43'),(6781,2648,377,14,'Unit level test cases are created and tested with the code changes. Audited the test case for the Manage Commision Feature. The expected and Actual behavior are captured in it.','ACE2040','2015-09-30 18:45:53','ACE2040','2015-09-30 20:39:43'),(6782,2648,377,15,'Functional Test cases are available with all browser level testing reports captured (SSP-STLR-TC-ManageObjectLocks.xls)','ACE2040','2015-09-30 18:45:53','ACE2040','2015-09-30 20:39:43'),(6783,2649,377,16,'Code is released to the customer repository on a mentioned time interval. ','ACE2040','2015-09-30 18:45:53','ACE2040','2015-09-30 20:39:43'),(6784,2649,377,17,'Deployment procedure is not available for the code deliverables','ACE2040','2015-09-30 18:45:53','ACE2040','2015-09-30 20:39:43'),(6785,2649,377,18,'Detailed build procedure is not required since the artifacts can be copied over FTP, but still it is recommended to mention it as notes probably in the Deployment procedure document','ACE2040','2015-09-30 18:45:53','ACE2040','2015-09-30 20:39:43'),(6786,2650,377,19,'Wireframes or Mock Screens are designed by the Aspire UI team. Usability standards are practiced in the designs','ACE2040','2015-09-30 18:45:53','ACE2040','2015-09-30 20:39:43'),(6787,2651,378,20,'Developers workspace is confi