 20:39:26','ACE2641','2015-10-05 20:53:05'),(6948,2713,386,19,'Cruise control, Follows aspire coding guidelines, CI available.','ACE2641','2015-10-05 20:39:26','ACE2641','2015-10-05 20:53:05'),(6949,2714,387,2,'TFS is used for Source Code Repository. There is no specific developer handbook which covers everything required for the\nproject. Instead they have Client Handbook and videos which explains the process. They don\'t have any specific folder structure for QA,UAT and LIVE environment in TFS. They are maintaining in single folder structure. Developers don\'t have any separate\nenvironment to do the integrated testing and currently it is not in our scope. Also, Client didn\'t prefer to have an separate environment for development. Instead they will check-in\nthe code and will do peer-testing for the integrated code.','ACE2641','2015-10-06 10:17:13','ACE2641','2015-10-06 12:17:21'),(6950,2714,387,3,'Available. \nSASS Project: QA= Controlled by Team \nLegacy Project: QA= Controlled by Client','ACE2641','2015-10-06 10:17:13','ACE2641','2015-10-06 12:17:21'),(6951,2714,387,4,'Available \nSASS Project: UAT/Live = Controlled by Client \nLegacy Project: UAT/Live = Controlled by Client \n\nSeparate JIRA ticket will be maintained for the release features.','ACE2641','2015-10-06 10:17:13','ACE2641','2015-10-06 12:17:21'),(6952,2714,387,5,'Yes. Available','ACE2641','2015-10-06 10:17:13','ACE2641','2015-10-06 12:17:21'),(6953,2715,387,6,'Available. Document available in TRAC.','ACE2641','2015-10-06 10:17:13','ACE2641','2015-10-06 12:17:21'),(6954,2715,387,7,'Maintained in JIRA tool. In TRAC tool also they are updating in an document manner. ','ACE2641','2015-10-06 10:17:13','ACE2641','2015-10-06 12:17:21'),(6955,2715,387,8,'Maintained in JIRA tool.\n\nProper Document name should be given.\nDocument Table of contents should be updated. Introduction section should be more elaborated. If we don\'t have any data for the section then it should be given as \" Note Applicable \". NFR section should have more content. (Ticket ID :7345)','ACE2641','2015-10-06 10:17:13','ACE2641','2015-10-06 12:17:21'),(6956,2716,387,9,'N/A for this audit as there is no design level implementation.','ACE2641','2015-10-06 10:17:13','ACE2641','2015-10-06 12:17:21'),(6957,2716,387,10,'N/A for this audit as there is no design level implementation for DB.','ACE2641','2015-10-06 10:17:13','ACE2641','2015-10-06 12:17:21'),(6958,2717,387,11,'1. Enum should be used when you are using string constants in switch case\n2. Always convert the string in to either upper case or lower case when doing the string comparison\n3. Avoid using .Tostring(). Use convert.tostring()\n4. Remove the unnecessary assignment of values to a string if you are going to use it in single time.\n5. Unused using should be used for newly created files. This is applicable for old files also.\n6. use string concentation instead of using \"+\" operator for merging the strings.\n7. Use try catch to avoid the page crash if any exception occured.','ACE2641','2015-10-06 10:17:13','ACE2641','2015-10-06 12:17:21'),(6959,2717,387,12,'N/A for this audit.','ACE2641','2015-10-06 10:17:13','ACE2641','2015-10-06 12:17:21'),(6960,2717,387,13,'N/A for this audit.','ACE2641','2015-10-06 10:17:13','ACE2641','2015-10-06 12:17:21'),(6961,2718,387,14,'This can\'t be created as this is maintenance project and client didn\'t accepted this as of now.','ACE2641','2015-10-06 10:17:13','ACE2641','2015-10-06 12:17:21'),(6962,2718,387,15,'Yes. Available. Captured in JIRA tool for the tickets.','ACE2641','2015-10-06 10:17:13','ACE2641','2015-10-06 12:17:21'),(6963,2719,387,16,'Yes. The target folder contain only tested source code. For SAAS project, it has been maintained in Release folder structure. For\nLegacy project, it has been maintained in main branch.','ACE2641','2015-10-06 10:17:13','ACE2641','2015-10-06 12:17:21'),(6964,2719,387,17,'As per the client instructions, BAT files are used for deployment process by the respectiv