r code analysis tool. The project is using auto build and deployment by using CI.','ACE0966','2015-10-30 17:44:35','ACE0966','2015-10-30 18:07:02'),(7309,2854,407,2,'Developers workspace configured properly.','ACE1193','2015-10-30 17:52:35','ACE1193','2015-10-30 18:12:52'),(7310,2854,407,3,'No separate QA system observed; UAT is where QA happens','ACE1193','2015-10-30 17:52:35','ACE1193','2015-10-30 18:12:52'),(7311,2854,407,4,'UAT environment is controlled by client.','ACE1193','2015-10-30 17:52:35','ACE1193','2015-10-30 18:12:52'),(7312,2854,407,5,'Code is in proper sync with target repository.','ACE1193','2015-10-30 17:52:35','ACE1193','2015-10-30 18:12:52'),(7313,2855,407,6,'Non functional requirements are not captured specifically.','ACE1193','2015-10-30 17:52:35','ACE1193','2015-10-30 18:12:52'),(7314,2855,407,7,'Requirements are captured partially through documents, but not analysis details are not captured or done extensively.','ACE1193','2015-10-30 17:52:35','ACE1193','2015-10-30 18:12:52'),(7315,2855,407,8,'NA','ACE1193','2015-10-30 17:52:35','ACE1193','2015-10-30 18:12:52'),(7316,2856,407,9,'Many issues found:\n1. Exceptions are just caught & thrown in models without deeper understanding.\n2. If a service is down, that is not being handled properly (e.g. MarketoService class).\n3. getLeadIDByEmail may return null. But passing it to addToList method without checking for null may result in error. Handle all the failure scenario.\n4. RandomLib Service - Remove this service and use the RandomLib directly in all places wherever needed, or put it inside a proper \"Utils\" which is used across application','ACE1193','2015-10-30 17:52:35','ACE1193','2015-10-30 18:12:52'),(7317,2856,407,10,'NA','ACE1193','2015-10-30 17:52:35','ACE1193','2015-10-30 18:12:52'),(7318,2857,407,11,'Issues:\na). Naming conventions\n1. Name the services/classes appropriately.\n2. SentinelService is dealing with user activty like login, signup, activation. It can be renamed to UserAuthentication or Authorization service.\n3. activateSentinel method in SentinelService should be renamed as activateUser.\n4. Try to avoid generic name for variables like $result. If its a boolean result then name it as $success or $isActivated etc.\n5. Testimonials model should be renamed in as Testimonial. Singular name for all models.\n6. SentinelService register method can be optimized by removing the else part and simply adding \"return false\" at end.\n\nMany more but this text in THI system is throwing \"Internal Server Error\", so unable to capture further.','ACE1193','2015-10-30 17:52:35','ACE1193','2015-10-30 18:12:52'),(7319,2857,407,12,'1. FormatService - If the scope of the method(getPhonePieces) is witthin the same class and not calling it anywhere, then declare the method as private.\n2. In formatPhone method $pieces== false should be $pieces === false or !empty($pieces). Because the $pieces may be boolean false or array.\n','ACE1193','2015-10-30 17:52:35','ACE1193','2015-10-30 18:12:52'),(7320,2857,407,13,'NA','ACE1193','2015-10-30 17:52:35','ACE1193','2015-10-30 18:12:52'),(7321,2858,407,14,'1. Rename the testcase file SentinelServiceTest to UserTest.\n2. Tests must be independent and should pass always.\n3. \"testAlreadyActivated\" method is directly checking user id=1. If this user not exist what happens.\n4. Try to initialize the test user in setup method by using mocks etc.\n5. Unit tests must be written for all the public methods.\n','ACE1193','2015-10-30 17:52:35','ACE1193','2015-10-30 18:12:52'),(7322,2858,407,15,'See above.','ACE1193','2015-10-30 17:52:35','ACE1193','2015-10-30 18:12:52'),(7323,2859,407,16,'Code released to target repository doesn\'t seem to be properly tested code. Note issues captured in \"Coding\" and \"Design\" sections.','ACE1193','2015-10-30 17:52:35','ACE1193','2015-10-30 18:12:52'),(7324,2859,407,17,'Deployment for all environments is handled by client.','ACE1193','2015-10-30 17:52:35','ACE1193','2015-10-30 18:12:52'),(732