INSERT INTO `thi_score` VALUES (1,189,54,'2013-04-19 18:44:25','2013-04-19 18:44:25','0.00','','','USER0058',2,'ACE0060','2013-04-19 18:44:27','ACE0060','2013-04-19 18:44:27'),(2,189,54,'2013-04-19 18:45:32','2013-04-19 18:45:32','2.00','','','USER0058',2,'ACE0060','2013-04-19 18:45:35','ACE0060','2013-04-19 18:45:35'),(3,189,54,'2013-04-19 18:54:11','2013-04-19 18:54:11','1.50','','1. Cruise control configuration required at the repository for automated builds.\n','USER0058',2,'ACE0060','2013-04-19 18:54:36','ACE0060','2013-04-19 18:54:36'),(4,189,54,'2013-04-19 18:50:25','2013-04-19 18:50:25','1.50','','1. Cruise control configuration required at the repository for automated builds.\n','USER0058',2,'ACE0060','2013-04-19 18:50:26','ACE0060','2013-04-19 18:50:26'),(5,189,54,'2013-04-19 18:46:56','2013-04-19 18:46:56','2.00','','1. Cruise control configuration required at the repository for automated builds.\n','USER0058',2,'ACE0060','2013-04-19 18:47:00','ACE0060','2013-04-19 18:47:00'),(6,105,52,'2013-04-29 17:39:10','2013-04-29 17:39:10','2.00','Design should be done for major enhancements. \nJUnits should be available for major enhancements. This has been given as a THI audit comment multiple times and still improvement is not there.','Explore on the possibility of including an automated build tool like hudson.','USER0029',1,'ACE0228','2013-04-29 17:39:10','ACE0228','2013-04-29 18:04:56'),(7,179,56,'2013-04-30 16:24:45','2013-04-30 16:24:45','1.40','Sampled the Jira - 2689 (Trac-567)  ticket','- Define the environment specification document. So that later that can be referred by new resources and do it by himself.\n- Identify the non functional requirement \n- Prepare the coding guidelines. So that people will avoid simple mistakes while developing. ','USER0090',2,'ACE0201','2013-04-30 16:24:46','ACE0201','2013-04-30 17:39:46'),(8,188,53,'2013-04-30 17:34:30','2013-04-30 17:34:30','2.50','Currently working on generalizing the code to support multi tenant.\n','- Should think of having single document explaining the exact changes to be done on the application rather than a complete Architecture / BRD\n- Should plan for having the nightly build process in place.\n- Also, plan to have RTM in place to have a better traceability.','USER0058',1,'ACE0067','2013-04-30 17:34:30','ACE0067','2013-04-30 17:55:42'),(9,140,56,'2013-04-30 17:40:28','2013-04-30 17:40:28','2.20','- Sampled the ID - 16418 - Disable Email Notification (Trac-872)\n','- Identify the NFR and prepare the document\n- Plan for local SVN repository and send the review and testing','USER0090',2,'ACE0201','2013-04-30 17:40:28','ACE0201','2013-04-30 23:41:00'),(10,190,51,'2013-04-30 17:46:55','2013-04-30 17:46:55','1.00','','','USER0058',1,'ACE0496','2013-04-30 17:46:55','ACE0496','2013-04-30 17:47:17'),(11,114,58,'2013-04-30 19:19:18','2013-04-30 19:19:18','0.00','','','USER0077',1,'ACE0279','2013-04-30 19:19:18','ACE0279','2013-04-30 19:19:18'),(12,204,59,'2013-05-14 14:35:29','2013-05-14 14:35:29','1.83','Impact assesment document to be maintained\n','Technical design document need to be maintained.\nAccessing external Services from BC layer need to be avoided.\nUnit testing need to be done','USER0077',1,'ACE1824','2013-05-14 14:35:29','ACE1824','2013-05-14 15:01:42'),(13,159,62,'2013-05-17 15:26:03','2013-05-17 15:26:03','2.00','They seems good in setting up the overall dev environment.','I recommend a checklist to be followed before check-in to the customer repository. ','USER0055',1,'ACE0805','2013-05-17 15:26:03','ACE0805','2013-05-17 15:26:03'),(14,120,60,'2013-05-20 11:41:50','2013-05-20 11:41:50','1.67','Even though It is legacy code, it would be better to eliminate the hard-code values and unwanted object initialization while doing the code changes for new enhancements. \n\nIf there is any additional impact is identified while doing the coding or unit testing, if those are not covered in Technical Approach or Impact analysis , then When deliver the code the those Gaps should be updated in the TA doc.s So that the it would be help the team to find the issues in any other phases .','Keeping a detailed code review process or check list. \nIdentifying the Gaps in TA and implementation in the post coding phase.\nKeep the UTC with per-requisites, Sample Test Data. If any limitations in the development environment \n','USER0077',2,'ACE0457','2013-05-20 11:41:50','ACE0457','2013-05-21 13:11:15'),(15,114,58,'2013-05-20 15:48:00','2013-05-20 15:48:00','2.00','Maintaining the documents properly.\nScripts are maintained for each releases properly in TFS.','Need to add the machine configuration \nNeed to maintain the system configuration/software requirements of the QA machines.\nNeed to perform some impact on the background process involved. \nSuggestion : no comments on the scripts level changes. They need to think on rollback scripts for the released scripts. currently no rollback scripts provided with the release files. \n\nNeed to cover the negative test cases while doing the unit/functional testing.','USER0077',2,'ACE0279','2013-05-20 15:48:00','ACE0279','2013-05-21 16:53:51'),(16,111,57,'2013-05-21 17:35:35','2013-05-21 17:35:35','1.33','VR Follow the existing process & standards defined by customer.','Need to update the developer setup guide.\nImpact Analysis doc is must for all the CR not only for Complex CR\nUse FxCop & NDepent  for IR , Dealsuite , PM.\nFollow NDepent advice to improve product\nNeed to write Unit test case for upcomming module\nNeed improve the release process\n','USER0077',2,'ACE0992','2013-05-21 17:35:35','ACE0992','2013-06-04 10:13:57'),(17,169,60,'2013-05-22 15:14:41','2013-05-22 15:14:41','1.83','The Impact Analysis could be little more elaborate to describe about method level affected areas. \n\nNFRS should be identified in the Requirement or IA Phase.\n\nDB calls in the FOR loop could have been avoided.\n','need to cover the performance aspect in the code review. \nUnit test case preparation should be mandated. ','USER0298',2,'ACE0457','2013-05-22 15:14:41','ACE0457','2013-05-27 17:46:06'),(18,137,58,'2013-05-23 11:37:55','2013-05-23 11:37:55','1.43','Since User Stories or Sprints maintained in TRAC.  ','Need to Maintain the Development and QA Environment setup documents.\nImpact Document struture should be maintained in-order to understand the impact of the changes. Currently team maintaining the document which holds the Proposed implementation/changes which is also updated after the development. \nSuggestion: Encrypt the query string values and handle for valid and invalid values. \nNeed to cover the testing to handle the invaid requests. \nSuggestion: to mantain the reports produced by the JSLint in TRAC. ','USER0031',1,'ACE0279','2013-05-23 11:37:55','ACE0279','2013-05-23 14:00:25'),(19,107,61,'2013-05-27 15:07:20','2013-05-27 15:07:20','1.57','Delivered Pricing Project :-\n\nOverall good but some documentation is required so that it is very easy to audit also it will be useful for a new resource to understand the different environment structure in a better way.','Delivered Pricing Project :-\n\nIt is good if we have a detailed document which will elaborately explains the TFS solution structure, branching solution details and backup and restore plan for TFS etc\n\nDefine a process for handling major and minor enhancement and document all the requirements and put it in common repository so that all can refer and follow the same folder structure.\n\nCreate architecture, high level and low level design document which will sync with the current code base and store it in a common repository.\n\nTry to have coding standard document, performance guidance documents for the developers so that code will be uniform and neat. \n\nAlso execute the code analysis tools like FxCop, JSLint (for .js files) so that code quality will improve.\n\nThough you are reusing the existing SP\'s try to cleanup or fine tune the business logic in a way such that will boost the query performance.','USER0569',2,'ACE1014','2013-05-27 15:07:20','ACE1014','2013-05-27 15:53:42'),(20,119,59,'2013-05-28 14:13:20','2013-05-28 14:13:20','2.50','Overall project is in good status from THI perspective.','Code refactoring is recommended in methods which populate data from data reader.\n','USER0031',1,'ACE1824','2013-05-28 14:13:20','ACE1824','2013-05-28 17:44:49'),(21,187,57,'2013-05-31 14:58:58','2013-05-31 14:58:58','1.29','Fleetorb9-AssetTracking is started with POC & then move to development. And most of the decisions are made by client.','Need TFS knowledge for new developers.\nPOC Study has to be documented.\nDB Design document will help the team members while doing Impact Analysis.\nDB Scripts are missing in TFS.\nNeed to write NUnit, JsLint\nNeed to Strong code review at js code because lot of logic are done at JS. Else performance will be big issue.','USER0064',1,'ACE0992','2013-05-31 14:58:58','ACE0992','2013-06-06 14:14:51'),(22,141,50,'2013-06-20 10:49:39','2013-06-20 10:49:39','0.00','Source control and environments are maintained properly. ','* Should focus on coding guidelines. \n* Review process should improve to catch unforeseen circumstances. \n* Can plan for implementing a memory-based queue (instead of DB-based) for improved performance.','USER0104',2,'ACE1193','2013-06-20 10:49:39','ACE1193','2013-06-24 11:17:59'),(23,147,50,'2013-06-24 13:51:14','2013-06-24 13:51:14','0.00','Source code control is good. Unit testing is done properly.','* Implement proper indexes in database tables.\n* Implement a monitoring tool to keep an eye on disk space.\n* Upgrade Oauth library from 1.0a to 2.0.\n* Plan for an upgrade of Doctrine 1.2 to Doctrine 2.0, since 1.2 is pretty much outdated and not supported any more by the community.','USER0104',1,'ACE1193','2013-06-24 13:51:14','ACE1193','2013-06-24 13:57:46'),(24,227,56,'2013-06-26 10:52:01','2013-06-26 10:52:01','2.40','Verified the sample jira ticket - INTRA-924 which has very minimal java changes and for the past six months they are involving on the automation testing.','Have a practice of daily code synchronization with repository and prepare NFR for the Oracle Forms migration requirement','USER0029',2,'ACE0201','2013-06-26 10:52:01','ACE0201','2013-06-26 20:43:10'),(25,188,53,'2013-06-26 10:53:17','2013-06-26 10:53:17','1.83','The rework is happening and not much clear visibility seem to exist on the plan.','1. Please have one repository. Like the version 3.3 seem to be obsolete. but the repository would also be removed. Please move it to the new repository.\n2. Impact analysis on the further work needs to be done in depth\n3. Code comments need to be verified\n4. Coverage through the JUnit needs to be evaluated.','USER0058',1,'ACE0067','2013-06-26 10:53:17','ACE0067','2013-06-28 19:19:58'),(26,190,53,'2013-06-26 22:19:08','2013-06-26 22:19:08','2.71','Generally good in the aspects being followed.','- need to concentrate on the normalization and data types used for the primary key columns in db design\n- DB unit needs to be added with all possible test scenarios to ensure quality\n','USER0058',1,'ACE0067','2013-06-26 22:19:08','ACE0067','2013-06-26 22:59:41'),(27,105,54,'2013-06-27 12:34:00','2013-06-27 12:34:00','1.67','THI conducted on a enhancement work, it\'s good.  There are minor gaps in the development activity which can be regulated in a phased manner.','1. Bring in the design phase to include LLD for each of the development activity.\n2. Revisit the NFR and keep update to the current standards and activities.','USER0029',2,'ACE0060','2013-06-27 12:34:00','ACE0060','2013-06-27 12:59:22'),(28,189,54,'2013-06-27 15:31:12','2013-06-27 15:31:12','1.67','Availability of requirement and LLD is very good.  There are few grey areas which can be sorted out via bringing standards and KT.','1. Introduce NFR.\n2. Share the production environment setup with team members.\n3. Bring in standards to the db table naming convention.\n4. Avoid manual configuration changes at onsite on the codebase for deployment.\n','USER0058',1,'ACE0060','2013-06-27 15:31:12','ACE0060','2013-06-27 19:38:03'),(29,109,56,'2013-06-28 19:16:00','2013-06-28 19:16:00','2.33','Verified the case FA1037US00-PCP Instructions Module (former Digital Instructions). \n\n ','Even the code is developed for customer demo, please do functional test. ','USER0014',1,'ACE0201','2013-06-28 19:16:00','ACE0201','2013-07-01 19:36:44'),(30,109,56,'2013-07-01 11:14:35','2013-07-01 11:14:35','0.00','','','USER0014',2,'ACE0201','2013-07-01 11:14:35','ACE0201','2013-07-01 11:14:35'),(34,106,56,'2013-07-02 22:58:10','2013-07-02 22:58:10','2.00','Audited the iTrack-28363 - Secure FTP implementation','Prepare the NFR for the project.','USER0014',2,'ACE0201','2013-07-02 22:58:10','ACE0201','2013-08-23 15:38:40'),(35,161,51,'2013-07-04 15:52:01','2013-07-04 15:52:01','0.00','Dev','','USER0104',2,'ACE0496','2013-07-04 15:52:01','ACE0496','2013-07-04 15:52:01'),(36,120,60,'2013-07-29 11:49:32','2013-07-29 11:49:32','2.00','Over-all the code quality for this particular sample WWRTM264 is good.\nProject has started following the UTC and execution. It is a good improvement. \nProject is using SONAR tool to measure the code quality. it is one of the best practice there.\n\nAs there was a new page development, it should have LLD or Technical impact analysis and review before started in to the coding. But a enhancement was delivered without having a LLD/Technical Spec. ','Technical Impact Analysis and LLD should be mandated, if there is any new screen . feature developments. ','USER0077',2,'ACE0457','2013-07-29 11:49:32','ACE0457','2013-08-21 16:11:26'),(37,143,59,'2013-08-06 12:45:01','2013-08-06 12:45:01','2.00','Scope of the Audit: Premium Billing (Scratch Development) \n\nRefactoring of code required to avoid transaction script pattern in ProcessAutoAdjustment() method\n\nColumn information to be mentioned in the design document \n\nUnit test classes should be created\n','Refactoring of code required to implement Dependency Injection\n\nPerformance to be tuned for SP: GetBillsPerEmployeePerPlan\n','USER0064',1,'ACE1824','2013-08-06 12:45:01','ACE1824','2013-08-06 18:00:03'),(38,152,53,'2013-08-07 15:59:26','2013-08-07 15:59:26','2.57','We are involved on the presentation layer implementation of the application.  Need to build up the expertise on the business area to ensure a greater quality on the implementation.\nSecurity related constraints and testing is recommended as being this a banking product.','JUnit can be used extensively and coverage could be enhanced on the unit testing.\nAlso, please start involving much on to the design activities to enhance the visibility more than the presentation side of the application.','USER1964',1,'ACE0067','2013-08-07 15:59:26','ACE0067','2013-08-07 17:37:45'),(39,111,57,'2013-08-08 14:29:49','2013-08-08 14:29:49','1.67','2\n2\n1\n1\n1\n1\n','','USER0077',2,'ACE0992','2013-08-08 14:29:49','ACE0992','2013-08-08 15:21:22'),(40,251,52,'2013-08-12 12:02:46','2013-08-12 12:02:46','2.00','Approval for technology upgrade is not available.\n','Continuous Integration must be set up.\nCode review must be effective. \nCode review not captured logical flaw in a method \'exportAndEmail\'.\nCurrently there is no mechanism to track review of  corresponding tasks. Apart from that review must be taken to closure. ','USER0058',2,'ACE0228','2013-08-12 12:02:46','ACE0228','2013-08-12 13:11:39'),(41,137,58,'2013-08-12 19:20:05','2013-08-12 19:20:05','1.50','Development and QA environment configuration details should be included in-order to raise new system request in future. \nCoding and Unit Testing has some scope for improvement. ','Review the code with respect to Code Maintainability and Performance will bring improvement on the coding. ','USER0031',1,'ACE0279','2013-08-12 19:20:05','ACE0279','2013-08-13 12:28:53'),(42,110,52,'2013-08-13 12:13:37','2013-08-13 12:13:37','1.60','Code review is not efficient.\n\nReviewed ticket SS-33568. There are logical flaws which would have been captured in the review phase. \nOrgId should be appended to all the SQLs added/modified.  \n','Local SVN can be used for code review rather than patch review. ','USER0029',2,'ACE0228','2013-08-13 12:13:37','ACE0228','2013-08-13 13:08:54'),(43,107,65,'2013-08-13 15:10:34','2013-08-13 15:10:34','1.50','1. DB design can be improved\n2. Need to improve deployment process ','While designing table, make use of int datatype where ever possible instead of varchar\nDDL script should be re-runnable\nTry to use automated deployment tool','USER0569',1,'ACE1390','2013-08-13 15:10:34','ACE1390','2013-08-13 17:59:53'),(44,105,54,'2013-08-13 15:45:32','2013-08-13 15:45:32','1.50','There are some places for improvement to bring in good development practices.','1. Please bring in design phase in place.\n2. Be strict on junit test cases.','USER0029',2,'ACE0060','2013-08-13 15:45:32','ACE0060','2013-08-14 12:18:45'),(45,144,53,'2013-08-14 16:20:15','2013-08-14 16:20:15','1.50','Low level coding and testing are taken care. However, the next level of impact analysis / design needs more concentration.','Please start the practice of creating an impact analysis and design activity before implementation.','USER1904',1,'ACE0067','2013-08-14 16:20:15','ACE0067','2013-08-14 16:29:02'),(46,119,59,'2013-08-19 16:26:55','2013-08-19 16:26:55','2.43','Unit testing classes has been added for the new module \n\nIntroduced Sparks EA for maintaining technical design \n\nOverall project is in good status from THI perspective','Synchronization of design with code need to be done \n\nMore unit tests need to be created in order to cover all possible scenarios','USER0031',1,'ACE1824','2013-08-19 16:26:55','ACE1824','2013-08-20 17:24:51'),(47,169,60,'2013-08-20 15:20:18','2013-08-20 15:20:18','1.60','As the team is working mostly in production support tickets.\nSo there is no much in Design and LLD works. \n\nwith respect to code quality for the bug fixes. it requires improvement in doing the line by line review. There are  few basic standards are missing','Code review has to be improved for the bug fix tickets. \nthere are few basic .NET standards are missing it has to be covered in the development or review level','USER0298',2,'ACE0457','2013-08-20 15:20:18','ACE0457','2013-08-21 16:33:44'),(48,111,57,'2013-09-02 11:07:36','2013-09-02 11:07:36','2.00','','','USER0077',2,'ACE0992','2013-09-02 11:07:36','ACE0992','2013-09-02 11:07:36'),(49,109,56,'2013-09-02 11:09:53','2013-09-02 11:09:53','2.00','Audited the PT-ZT-PCP-F11263US00 ticket in the BHIP Payment Module. \n- Track the executed results in Trac tool.\n','- Earlier they have written JUnit and stopped it now. They can implement it.\n- NFR document is under progress for a long time. Need to derive ASAP.\n- Suggested to bring the DB table Audit columns - CREATEDDATE, CREATEUSER, CHANGEDDATE, CHANGEDUSER.\n','USER0090',2,'ACE0201','2013-09-02 11:09:53','ACE0201','2013-09-26 15:20:28'),(50,132,65,'2013-09-17 12:53:01','2013-09-17 12:53:01','1.40','Code & Script Comments are missing','Maintain design/impact analysis document. Add comments to code & script file.','USER0380',2,'ACE1390','2013-09-17 12:53:01','ACE1390','2013-09-17 13:02:59'),(51,191,61,'2013-10-01 11:48:39','2013-10-01 11:48:39','0.00','','','USER0031',1,'ACE1014','2013-10-01 11:48:39','ACE1014','2013-10-01 11:48:39'),(52,187,65,'2013-10-03 17:30:38','2013-10-03 17:30:38','1.71','Keep only one Source control. \nDo not use Sp/Column names directly in code.\n','Address FxCop report\nMake use of Entity framework for retrieving data from DB and \nPopulating it in List object\n','USER0064',1,'ACE1390','2013-10-03 17:30:38','ACE1390','2013-10-04 18:06:38'),(53,119,59,'2013-10-29 14:53:09','2013-10-29 14:53:09','0.00','','','USER0031',1,'ACE1824','2013-10-29 14:53:09','ACE1824','2013-10-29 15:33:24'),(54,119,59,'2013-11-05 11:40:34','2013-11-05 11:40:34','2.14','In this cycle there is no major module level