nt understanding to deployment. \n3. All the documents were in place.\n	\n','1. No Code quality inspection tool (like FxCop) is being used.\n2. No Coding convention document is followed.\n3. Can go for auto build.\n4. Overall code quality is good, but new coding styles can be adopted.\n	\n','USER1227',1,'ACE2011','2014-01-22 11:43:58','ACE2011','2014-01-22 11:47:50'),(60,114,58,'2014-01-22 14:15:40','2014-01-22 14:15:40','2.00','Need to focus on the NFR while doing the documentation/ impact anlysis\nNeed to improve the quality on the exception handling.\n','This system design must be reviewed by any architect  (for the File Import Process 15.3/Sprint3). \n\nAll the resources should work with the updated source code from TFS.','USER0077',1,'ACE0279','2014-01-22 14:15:40','ACE0279','2014-01-22 16:11:02'),(61,120,60,'2014-01-24 14:56:42','2014-01-24 14:56:42','2.14','This project has used the following good practices like \n1. Unit test framework \n2. Code review tools \n3. Continuous integration system (integrated with Unit testing framework and Code review tool in the TeamCity build routine) . \n\nBased on SONAR report a new Coding quality improvement Task MAIN-744  Remove Time Zone related obsolete functions - has been planned for Feb 2014 release. It will be verified in the next THI audit\n\n ','Impact Analysis Phase has to be strengthen in the project, there 2 QA bugs could have been avoided if there was IA happened in all the features in the UI. \n\nAs this project is upgraded to  .NET framework work 4. it will be better use the features in the .NET 4 where ever possible and refactor the code. ','USER0077',2,'ACE0457','2014-01-24 14:56:42','ACE0457','2014-01-24 15:13:57'),(62,269,66,'2014-01-24 16:01:24','2014-01-24 16:01:24','2.50','1. Plan to understand the complete architecure of system.\n2. Mark proper comment in code.\n','1. Should use code evaluation tools (FxCop or  Visual Studio code evaluation..etc)\n2. Better to have peer code review  and unit testing p