unit testing.\n* Improve on Git commit messages. Use present tense and verb form.','USER2175',2,'ACE1193','2014-12-31 19:24:18','ACE1193','2014-12-31 19:30:37'),(201,185,83,'2015-01-21 12:58:48','2015-01-21 12:58:48','2.00','Overall they have covered all the process','1.Set DB connection time out globally for the application\n2. Handle transaction management either in DB or code.\n3. Compare the data type and size of fields in table and procedure to avoid loss of data.\n4. Implement Unicode DB type for multilingual site implementation.\n5. Add default values to Table instead of hard code in the query.\n6. Add identity column and index for fast record retrieval.\n7. Use Log4net or Microsoft Enterprise library for better exception handling , do not use file stream for log and it decreases the application performance.\n8. Avoid passing more arguments in the method, instead use Class as an argument.\n9. Add optional parameter in procedure to avoid un wanted hardcoded value in program.\n10. Use Data reader for fetching rows from DB instead of using Data set.\n','USER0055',1,'ACE1420','2015-01-21 12:58:48','ACE1420','2015-01-30 10:10:37'),(202,426,84,'2015-01-21 15:50:14','2015-01-21 15:50:14','1.43','No tracking of issues\nNo proper checking in \nNo backup process even in PD\nDev environment is not sync with PD\nCode cleanup required\n','1. Prevent anonymous user access to system pages like layout pages.\n2. Try to use server side cache wherever possible.\n3. Optimize the images, js with respect to size.\n4. Specify the target list in elements.xml of the Event Receiver feature.\n5. General cleanup:  Add IsPostBack check in Page load event of web parts, Add regions, comments etc.\n6. Reduce the number of lines in events and methods. Try to have sub methods.\n7. Add try catch; catch more specific exception like SPException in methods.\n8. Use enterprise library\\log4net for logging.\n9. Recommended to use validations tools like JsHint or JsLint to validate the javascript .\n10.Try to move inline javascript used in webparts to common js.\n11.Remove unused class files from projects. They can be restored from SVN if needed.\n12.Try to fetch only the required list items from list if pagination is applied (in this case it was a picture library).\n','USER0055',1,'ACE1783','2015-01-21 15:50:14','ACE1783','2015-01-22 16:30:47'),(203,293,80,'2015-01-22 12:37:59','2015-01-22 12:37:59','2.00','Overall the standards are met \n','Design documents can be created \nSite Backup on a periodic basis should be created\nShould take care while creating static classes which will be invoked in a threaded infrastructure like workflows','USER0055',1,'ACE0880','2015-01-22 12:37:59','ACE0880','2015-01-22 13:14:21'),(204,148,85,'2015-01-22 13:15:37','2015-01-22 13:15:37','1.86','Good','Valid exception should be handled and instead of general exception logged at event viewer, it should be logged in a log file using either log4net or Enterprise exception logging , so it is easy to find out the reason for bugs.\n\n','USER0055',2,'ACE0557','2015-01-22 13:15:37','ACE0557','2015-01-22 18:18:48'),(205,213,81,'2015-01-23 08:48:29','2015-01-23 08:48:29','2.50','Good','Unit testing can be improved in all projects.\nCurrently in this project its more of functional, need to be improved to be more data oriented.','USER0055',2,'ACE0147','2015-01-23 08:48:29','ACE0147','2015-01-23 09:01:03'),(206,140,70,'2015-02-26 11:01:19','2015-02-26 11:01:19','2.50','In this customer support application, code is well documented and code quality in general is fine. CI is achieved using Jenkins in Aspire environment and Sonar is integrated.','This is more of an observation/question rather than recommendation.\nPresently application generates 3GB of log file per day and retained for a month. \nThough all are useful information (including call details), is it feasible to reduce the size of this log file.','USER1904',1,'ACE2158','2015-02-26 11:01:19','ACE2158','2015-02-26 11:29:16'),(207,152,7