rity.\n2. automate the deployment procedures.','USER0084',1,'ACE0060','2015-03-10 14:51:44','ACE0060','2015-03-10 15:09:48'),(217,188,54,'2015-03-10 15:10:54','2015-03-10 15:10:54','1.67','gaps are there in coding consistency.  remaining things are in place but those to be improvised.','1. coding conventions to be improvised.\n2. deployment steps.\n','USER0084',1,'ACE0060','2015-03-10 15:10:54','ACE0060','2015-03-10 15:18:02'),(218,345,53,'2015-03-10 15:51:44','2015-03-10 15:51:44','2.50','The output has come out very good with the miniature application working through the self guided installer.\n','However, there are couple of points that would be good to be made note of\n* The low level design should also be created and approval sought to avoid later challenges\n* more scenarios to be added to the junit based automated testing to avoid manual intervention','USER2721',1,'ACE0067','2015-03-10 15:51:44','ACE0067','2015-03-10 16:19:21'),(219,269,75,'2015-03-10 17:42:57','2015-03-10 17:42:57','0.80','Documents related to the project are stored in P drive not in local repository. Suggestion given to the team to create a local repository for the documents.\n\nCode Review:\n\n1. GROUP BY is used inside of an \"IN\" condition for a view. Suggestion provided the team to change this for performance optimization.\n\n2. Non-nullable DateTime variable is validated with null check. This condition never executed. Suggestion provided to the team to change this validation with DateTime.MinValue\n\n3. Hardcoded string values found in source code. Suggestion provided to the team, that to move the hardcoded values into Constant file. (Team informed that they need to discuss about this with client)\n','Documents related to the project are stored in P drive not in local repository. Suggestion given to the team to create a local repository for the documents.\n\nCode Review:\n\n1. GROUP BY is used inside of an \"IN\" condition for a view. Suggestion provided the team to change this for performance optimization.\n\n2. Non-nullable DateTime variable is validated with null check. This condition never executed. Suggestion provided to the team to change this validation with DateTime.MinValue\n\n3. Hardcoded string values found in source code. Suggestion provided to the team, that to move the hardcoded values into Constant file. (Team informed that they need to discuss about this with client)','USER2231',1,'ACE0966','2015-03-10 17:42:57','ACE0966','2015-03-30 15:59:14'),(220,114,58,'2015-03-11 12:25:31','2015-03-11 12:25:31','2.17','The process followed by that team is very good and they maintain all the required document. They can start focusing on the Exception handling and changing the older implementations wherever possible. ','Custom Exception Handling\nResource file implementation\n\n','USER0077',2,'ACE0279','2015-03-11 12:25:31','ACE0279','2015-03-11 12:42:25'),(221,118,67,'2015-03-18 10:51:21','2015-03-18 10:51:21','2.20','The change was limited to UI change, i.e. converting an existing screen to a different look and feel.		\n','While comparing strings, convert the strings to a similar case and then compare Or use an overload of String.Equals to ensure comparison doesn\'t fail because of string case.		\n','USER1223',1,'ACE2011','2015-03-18 10:51:21','ACE2011','2015-03-18 10:52:02'),(222,143,78,'2015-03-23 19:51:57','2015-03-23 19:51:57','1.33','Found no code review made for the completed module. The same point has been insisted in last audit cycle. Need to make the code review mandatory for all the changes/bug fixes. Also code quality need to be improved based on the audited item in terms of security, vulnerability, performance and scalability. Ensure to use FxCop or other code analysis before making any code check-in. ','1) Identify and fix all code that is vulnerable to script attacks.\n2) Use sealed classes wherever appropriate.\n3) DB Scripts need to be created with all required constraints. Fix the cases which is identified in the audit. Also