ation generates 3GB of log file per day and retained for a month. It\'s nice to see this log file being compressed automatically.','USER1904',1,'ACE2158','2015-03-31 10:44:17','ACE2158','2015-03-31 11:10:05'),(227,477,50,'2015-03-31 11:28:12','2015-03-31 11:28:12','2.00','CI integrated with Sonar and PHPUnit.','Git commit messages should be improved. Build should be stable.','USER2175',2,'ACE1193','2015-03-31 11:28:12','ACE1193','2015-03-31 11:35:03'),(228,141,50,'2015-03-31 11:36:30','2015-03-31 11:36:30','2.50','Requirements are captured and handled properly.','Longer functions/methods should be broken down to smaller ones. Coding conventions (e.g. consistency in variable names) need improvement. Bring build into Aspire\'s central build server.','USER0332',2,'ACE1193','2015-03-31 11:36:30','ACE1193','2015-03-31 11:44:02'),(229,415,50,'2015-03-31 11:45:46','2015-03-31 11:45:46','2.43','Coding standards, design are good in general.','Pull requests must never be submitted when a build fails. Take immediate action in such cases, or keep client informed through some channels (like email or Flowdock chat).','USER2175',2,'ACE1193','2015-03-31 11:45:46','ACE1193','2015-03-31 12:00:43'),(230,131,79,'2015-03-31 15:09:31','2015-03-31 15:09:31','0.50','Code quality is not good.','Peer review on the programming logic, functionality perspective, coding layout and naming conventions should be done','USER0031',2,'ACE0681','2015-03-31 15:09:31','ACE0681','2015-03-31 15:39:49'),(231,106,52,'2015-03-31 17:40:25','2015-03-31 17:40:25','0.00','Sonar & CI not completed and hence the score is zero. \n\nThere are many issues in code which should have been captured in Sonar review. Since it is a new development, this should be taken seriously. \n\nThe team is less confident on answering why and how ZK framework has been chosen and implemented.','A proper guidelines document must be available for the development approach and using standards.\n\nConsider the performance of the application.\