quirement says, instead suggest them if you have good approach, this will really get good appreciation from client.  \n\n3. I did not see any logging feature implemented in this application, spend some time or get estimation from client to add logging in Tech soup. This will be useful when you get any production issue to find the root cause.\n\n4. Please handle exception at least in public methods.\n\n5. If your application entirely supports Multi lingual, then do not hard code text directly in controls instead add text and take it from resource file.\n\n\n','USER0055',2,'ACE0557','2015-11-12 13:11:42','ACE0557','2015-11-12 17:13:51'),(414,599,83,'2015-11-12 17:16:04','2015-11-12 17:16:04','1.89','They have done good design and analysis in the requirement. \n','They can follow the below practices:\n\n1. Use Region to describe about the function\n2. Not used any Exception Handling\n3. Logging across the code is missing','USER0055',1,'ACE1420','2015-11-12 17:16:04','ACE1420','2015-11-12 17:30:17'),(415,213,84,'2015-11-13 14:32:14','2015-11-13 14:32:14','2.40','Regions was missing in some of the code blocks\nLibrary has been directly used instead of declaring in the top (System.windows.forms)\nSome of the places naming convention is not properly followed\n','Please follow the naming convention document recommended by your client','USER0055',2,'ACE1783','2015-11-13 14:32:14','ACE1783','2015-11-20 11:43:17'),(416,282,79,'2015-11-19 10:42:07','2015-11-19 10:42:07','1.80','Unit testing needs to implemented. Code analysis, JSlint and Stylecop needs to configured for reviewing the code.','Unit testing needs to implemented. Code analysis, JSlint and Stylecop needs to configured for the application. Periodic code review would help the team improve on their coding standards.\n','USER0021',2,'ACE0681','2015-11-19 10:42:07','ACE0681','2015-11-30 17:03:26'),(417,109,71,'2015-11-20 12:42:49','2015-11-20 12:42:49','1.48','DB Analysis and design should done. Design review should be m