rovide both success and failure notification to user for any operation , today I\nseen your module contains only failure message and don\'t stick with\nonly what client requirement says, instead suggest them if you have\ngood approach, this will really get good appreciation from client. \n\n3. I did not see any logging feature implemented in this application, spend\nsome time or get estimation from client to add logging in Tech soup.\nThis will be useful when you get any production issue to find the root\ncause. \n4. Please handle exception at least in public methods.\n\n 5. If your application entirely supports Multi lingual, then do not hard code text\ndirectly in controls instead add text and take it from resource file.','USER0055',1,'ACE0880','2016-01-19 20:53:12','ACE0880','2016-01-19 23:53:50'),(462,114,75,'2016-01-27 15:52:06','2016-01-27 15:52:06','2.42','Last THI comments: Suggestion provided to create DB design understanding document. - Team informed that they are currently working on creating DB design document.\n\nCode comments are not available for a class file. JS, CSS code are found at ascx file. - team informed that currently they are working on this.\n\n This month THI comments: The team is following the standards and practices for the newly developed code. The team have proper documents for requirement, environment and technical/NFR. The team follows best practices and polices wherever applicable. ','Suggestion provided to use constants instead of hard-coding strings in source codes.','USER2975',1,'ACE0966','2016-01-27 15:52:06','ACE0966','2016-01-27 16:51:58'),(463,131,79,'2016-01-28 09:41:55','2016-01-28 09:41:55','2.29','The non-functional requirements needs to identified based on the application\'s requirements and discussed with client and request for client\'s feedback. This document should be referenced for any feature development or bug fixes.','The non-functional requirements needs to identified based on the application\'s requirements.','