ailable. Code review comments given in this audit are 1. Remove the unreferenced variables,files. Found some of the files are not refererenced anywhere.\n2. Use a method to fetch values from the config file.\n3. Use Using keyword in the dataaccess layer. Unit test classes, cases are not available. No deployment procedure & build available. Team have started exploring CI/CD using Jenkins but not implemented completely. No usability best practices have been followed.','Resharper can be used to perform code clean up. The documents should prepare in Aspire template. The continuous integration which is in progress currently should be implemented in all the projects. The usability best practices needs to be introduced in all the projects.','USER2236',1,'ACE3213','2016-12-22 17:44:50','ACE3213','2016-12-22 17:49:05'),(722,169,87,'2016-12-26 14:34:05','2016-12-26 14:34:05','2.56','For this audit, there are only few changes with respect to code level, script level and config level. Team has followed the standards in that. Also the are working majorly on extracting the data from the database and submitting as an report to the supplier as they need.','Project meets the expectation.','USER2231',2,'ACE2641','2016-12-26 14:34:05','ACE2641','2016-12-26 16:05:58'),(723,269,87,'2016-12-26 16:23:12','2016-12-26 16:23:12','2.56','Project meets the expectation. Team is currently working on few installation tasks, deployment and release activities for the past couple  of months.','Earlier, it was recommended to use code analysis tool but it cant be implemented as it will be executed against all the source code which is an invalid. As developers are supposed to work on the bug fixes alone.','USER2231',2,'ACE2641','2016-12-26 16:23:12','ACE2641','2016-12-26 16:32:15'),(724,137,87,'2016-12-26 16:35:33','2016-12-26 16:35:33','2.05','Project meets the expectation. Team is currently implementing the team-city for CI/CD.','Suggested to use Jasmine Framework and chutzpah Test runner for javascr